(1, 1, '2015-05-09 01:01:18', '2015-05-08 18:01:19', 'Selamat datang di WordPress. Ini adalah tulisan pertama Anda. Sunting atau hapus, kemudian mulai blogging!', 'Halo dunia!', '', 'publish', 'open', 'open', '', 'halo-dunia', '', '', '2015-05-09 01:01:18', '2015-05-08 18:01:19', '', 0, 'http://localhost/toko-online/?p=1', 0, 'post', '', 1),
(2, 1, '2015-05-09 01:01:18', '2015-05-08 18:01:19', 'Ini adalah sebuah contoh Laman. Berbeda dari sebuah Pos blog sebab laman semacam ini memiliki lokasi tetap, dan memiliki sebuah tautan pada menu navigasi situs Anda (pada sebagian tema). Biasanya, penulis memulai dengan menulis laman Tentang untuk memperkenalkan dirinya pada para calon pengunjung situs. Isinya dapat berupa:\n\n<blockquote>Hai! Saya adalah seorang kurir jasa paket yang hobi nge-blog. Lahir dan besar di Indonesia, sejak SMA sudah jatuh cinta pada jazz (musiknya orang WordPress)</blockquote>\n\n...atau seperti ini:\n\n<blockquote>Automattic Inc. adalah perusahaan perangkat lunak yang didirikan pada bulan Agustus 2005 oleh Matt Mullenwegg (pelopor WordPress). Berkantor pusat di Amerika Serikat, perusahaan kami mempekerjakan ratusan programmer yang tersebar di 5 benua.</blockquote>\n\nSebagai pengguna baru di WordPress, Anda sebaiknya segera membuka <a href="http://localhost/toko-online/wp-admin/">Dasbor Anda</a> untuk menghapus laman ini dan membuat laman baru sesuai keinginan Anda. Have fun!', 'Laman Contoh', '', 'publish', 'open', 'open', '', 'laman-contoh', '', '', '2015-05-09 01:01:18', '2015-05-08 18:01:19', '', 0, 'http://localhost/toko-online/?page_id=2', 0, 'page', '', 0),
